const mongoose = require("mongoose");
const Kita = require("../models/Kita");

mongoose.connect("mongodb://localhost/kita");

const processedKitas = kitas.map(kita => {
kita._id = null
if (!kita.lat === ""){
kita.lat = parseFloat(kita.lat)
} if (!kita.long === "") {
kita.long = parseFloat(kita.long)
} 
return kita
})


Kita.insertMany(processedKitas)
.then(documents => {
  console.log(`Success! ${documents.length}, kitas were added`);
  mongoose.connection.close();
})
.catch(err => {
  console.log(err);
});